The following is an example of a Discord bot written in JavaScript using the Discord.js library. This bot has one command, "ban", which is a slash command.

Bot.on("messageCreate", async (msg) => {
  if (!msg.guild || !msg.member) return;
  if (msg.content === "/ban") {
    const user = msg.mentions.users.first();
    if (!user) return msg.reply("Please mention a user to ban.");
    await msg.channel.send(`Banning ${user}...`);
    try {
      await msg.guild.members.ban(user);
      msg.reply(`${user} was banned.`);
    } catch (err) {
      msg.reply(`Failed to ban ${user}.`);
    }
  }
});

