function isPrime(numbers) {
    let result = false;
    for (let i = 0; i < numbers.length; i++) {
        if (numbers[i] === 1 || numbers[i] === 2) continue; // skip 1 and 2 because they are not prime numbers
        if (numbers[i] % 2 !== 0 && numbers[i] > 3) {
            result = true;
            break;
        }
    }
    return result;
}
