A for loop is used in Python programming language to iterate over a sequence of items, such as a list or tuple. The syntax of a for loop in Python is as follows:

for item in sequence:
    statement(s)

The "item" variable represents each element of the sequence, and the "statement(s)" block contains one or more statements that will be executed once for each element in the sequence. For example, if you have a list of numbers called nums, you can use a for loop to print out each number in the list like this:

for i in nums:
