public class Solution {
    public boolean isPowerOfThree(int n) {
        if (n < 0 || n > Integer.MAX_VALUE / 3) {
            return false;
        }

        if (n == 0) {
            return false;
        }

        if (n == 1) {
            return true;
        }

        if (n == 3) {
            return true;
        }

        return isPowerOfThree(n / 3);
    }
}

