The following is an example of a C++ program that reads a text file line by line and counts the number of occurrences of a specific word in the file. The program takes as input a text file containing lines of text, and outputs the total number of occurrences of the specified word on each line of the text file.

// Program to count the number of occurrences of a word in a text file
#include <iostream>
#include <fstream>
#include <string>
using namespace std;
int main() {
    ifstream fin("input.txt"); // Open the input file "input.txt" for reading
    string line; // Declare a string variable named "line"
    int counter = 0; // Initialize the counter variable to zero
    while (getline(fin, line)) { // Read each line from the input file into the string variable "line"
        cout << line << endl; // Print each line from the input file to the console
        for (int i = 0; i < line.length(); ++i) { // Loop through each character in the string variable "line"
            if (line[i] == 'a') { // If the current character is equal to the letter 'a', increment the counter variable by one
                counter++;
            }
        }
    }
    cout << "Total number of occurrences of the word \"a\" in the text file: " << counter << endl; // Print the total number of occurrences of the word "a" in the text file

